import React, {useState} from 'react';
import io from "socket.io-client"

function App() {

  console.log('hey:)')
  var socket = io.connect("http://localhost:4000")
  const [question, setQuestion] = useState("");
  socket.on('question', function(q){
    setQuestion(q)
  });
  return (
    <p>{question}</p>
  );
}

export default App;
